import React from 'react';
import Image from 'next/image';
const Img = React.memo(({
  src, alt = 'localhost', title, height, width, onClick, loading = 'lazy', layout = null, objectFit = null
}) => {
  const aspectRatio = (height / width) * 100;
  if (layout) {
    return (
      <>
        <Image
          layout={layout}
          loading={loading}
          src={src}
          alt={alt}
          title={title}          
          placeholder="blur"
          blurDataURL="data:image/jpeg;base64,"
          onClick={onClick}
          onKeyPress={() => true}
          role="presentation"
        />
      </>
    );
  }
  return (
    <>
      <Image
        height={height}
        width={width}
        loading={loading}
        src={src}
        alt={alt}
        title={title}
        placeholder="blur"
        blurDataURL="data:image/jpeg;base64,"
        onClick={onClick}
        onKeyPress={() => true}
        role="presentation"
      />
    </>
  );
});
Img.displayName = 'ImageComponent'
export default Img;
